css:
@-moz-document url-prefix("https://www.mp3juices.cc/") {
body {background-color:#111;color:#5382a7} 
#nav {border-bottom:1px #5382a7 solid}
#nav a:nth-child(n){color:#5382a7;}
#content > form {background:#407090;color:#5382a7;}
#content > form:focus {outline:none!important;}
#query:focus {outline:none!important;}
#query{color:#000!important;} 
#suggestions > span:nth-child(n) {background:#222!important;color:#aaa}
#suggestions {border:none!important;}
.result {background-color:#222;} 
.file,.margin {background:#333;color:#5382a7;}
.options > a:nth-child(n) {background:#333;}
#content > form > div.clear {background:none!important;}
#form_text a {color:#5382a7!important;}
#text > p:nth-child(4) > a {color:#5382a7;}
#control_sources {background:#333;color:#aaa;}
.enabled {background:#5382a7!important;}
.disabled {background:none!important;}
#sources a:nth-child(n){color:#aaa;}
#footer {border-top:1px #5382a7 solid;}
#footer a:nth-child(n){color:#5382a7;}
#logo {filter:brightness(50%)}
}
